	// linalg shortcuts
	function trans(matrix, x, y, z) {
		var a = matrix;
		a[3] += a[0] * x + a[1] * y + a[2] * z;
		a[7] += a[4] * x + a[5] * y + a[6] * z;
		a[11] += a[8] * x + a[9] * y + a[10] * z;
		a[15] += a[12] * x + a[13] * y + a[14] * z;
	}

	function rotX(matrix, angle) {
		var elems = matrix;
		var c = Math.cos(angle);
		var s = Math.sin(angle);
		var t = elems[1];
		elems[1] = t * c + elems[2] * s;
		elems[2] = t * -s + elems[2] * c;
		t = elems[5];
		elems[5] = t * c + elems[6] * s;
		elems[6] = t * -s + elems[6] * c;
		t = elems[9];
		elems[9] = t * c + elems[10] * s;
		elems[10] = t * -s + elems[10] * c;
		t = elems[13];
		elems[13] = t * c + elems[14] * s;
		elems[14] = t * -s + elems[14] * c;
	}

	function rotY(matrix, angle) {
		var c = Math.cos(angle);
		var s = Math.sin(angle);
		var elems = matrix;
		var t = elems[0];
		elems[0] = t * c + elems[2] * -s;
		elems[2] = t * s + elems[2] * c;
		t = elems[4];
		elems[4] = t * c + elems[6] * -s;
		elems[6] = t * s + elems[6] * c;
		t = elems[8];
		elems[8] = t * c + elems[10] * -s;
		elems[10] = t * s + elems[10] * c;
		t = elems[12];
		elems[12] = t * c + elems[14] * -s;
		elems[14] = t * s + elems[14] * c;
	}

	function transpose(matrix) {
		var temp = matrix[4];
		matrix[4] = matrix[1];
		matrix[1] = temp;

		temp = matrix[8];
		matrix[8] = matrix[2];
		matrix[2] = temp;

		temp = matrix[6];
		matrix[6] = matrix[9];
		matrix[9] = temp;

		temp = matrix[3];
		matrix[3] = matrix[12];
		matrix[12] = temp;

		temp = matrix[7];
		matrix[7] = matrix[13];
		matrix[13] = temp;

		temp = matrix[11];
		matrix[11] = matrix[14];
		matrix[14] = temp;
	}

	function matMult() {
		var proj = projection;
		var view = modelView;
		matrix[0] = proj[0] * view[0];
		matrix[1] = proj[0] * view[1];
		matrix[2] = proj[0] * view[2];
		matrix[3] = proj[0] * view[3];
		matrix[4] = proj[5] * view[4];
		matrix[5] = proj[5] * view[5];
		matrix[6] = proj[5] * view[6];
		matrix[7] = proj[5] * view[7];
		matrix[8] = proj[10] * view[8] + proj[11] * view[12];
		matrix[9] = proj[10] * view[9] + proj[11] * view[13];
		matrix[10] = proj[10] * view[10] + proj[11] * view[14];
		matrix[11] = proj[10] * view[11] + proj[11] * view[15];
		matrix[12] = proj[14] * view[8];
		matrix[13] = proj[14] * view[9];
		matrix[14] = proj[14] * view[10];
		matrix[15] = proj[14] * view[11];
	}

	function copyArr(a, b) {
		for (var i = 0; i < a.length; i++) {
			b[i] = a[i];
		}
	}

	// Apply field of vision
	function FOV(fov) {
		var tang = Math.tan(fov * 0.5 * Math.PI / 180);
		var scale = 1 / tang;
		var near = 1;
		var far = 1000000;
		currentFov = fov;
		nearH = near * tang;

		projection[0] = scale / width * height;
		projection[5] = scale;
		projection[10] = -far / (far - near);
		projection[11] = -1;
		projection[14] = -far * near / (far - near);

	}

	function cross(v1, v2, result) {
		var x = v1.x,
			y = v1.y,
			z = v1.z,
			x2 = v2.x,
			y2 = v2.y,
			z2 = v2.z;
		result.x = y * z2 - y2 * z;
		result.y = z * x2 - z2 * x;
		result.z = x * y2 - x2 * y;
	}

	// more linalg shortcuts
	function Plane(nx, ny, nz) {
		this.dx = nx > 0 ? 16 : 0;
		this.dy = ny > 0;
		this.dz = nz > 0 ? 16 : 0;

		this.nx = nx;
		this.ny = ny;
		this.nz = nz;
	}

	Plane.prototype.set = Plane;

	function computeFrustum() {
		var X = vec1;
		X.x = p.direction.z;
		X.y = 0
		X.z = -p.direction.x;
		X.normalize();

		var Y = vec2;
		Y.set(p.direction);
		Y.mult(-1);
		cross(Y, X, Y);

		var aux = vec3;
		aux.set(Y);
		aux.mult(nearH);
		aux.add(p.direction);
		aux.normalize();
		cross(aux, X, aux);
		p.frustum[0].set(aux.x, aux.y, aux.z);

		aux.set(Y);
		aux.mult(-nearH);
		aux.add(p.direction);
		aux.normalize();
		cross(X, aux, aux);
		p.frustum[1].set(aux.x, aux.y, aux.z);

		aux.set(X);
		aux.mult(-nearH * width / height);
		aux.add(p.direction);
		aux.normalize();
		cross(aux, Y, aux);
		p.frustum[2].set(aux.x, aux.y, aux.z);

		aux.set(X);
		aux.mult(nearH * width / height);
		aux.add(p.direction);
		aux.normalize();
		cross(Y, aux, aux);
		p.frustum[3].set(aux.x, aux.y, aux.z);
	}

	// Determine if chunk should be visible
	var chunkVisible = function (x, y, z, maxY) {
		x -= 0.5;
		y -= 0.5;
		z -= 0.5;
		maxY += 0.5;
		var px = 0,
			py = 0,
			pz = 0,
			plane = null;
		var cx = p.x,
			cy = p.y,
			cz = p.z;
		for (var i = 0; i < 4; i++) {
			plane = p.frustum[i];
			px = x + plane.dx;
			py = plane.dy ? maxY : y;
			pz = z + plane.dz;
			if ((px - cx) * plane.nx + (py - cy) * plane.ny + (pz - cz) * plane.nz < 0) {
				return false;
			}
		}
		return true;
	};

	var defaultModelView = new Float32Array([-4, 0, 0, 0, 0, 4, 0, 0, 0, 0, -4, 0, 0, 0, 0, 1]);
	var initModelView = function (x, y, z, rx, ry) {
		copyArr(defaultModelView, modelView);
		rotX(modelView, rx);
		rotY(modelView, ry);
		trans(modelView, -x, -y, -z);
		matMult();
		transpose(matrix);
		uniformMatrix("view3d", programObject3D, "uView", false, matrix);
	};
	var tex;

	function getFaces(x, y, z) {
		return p.x < x - 0.5 |
			(p.x > x + 0.5) << 1 |
			(p.y < y - 0.5) << 2 |
			(p.y > y + 0.5) << 3 |
			(p.z < z - 0.5) << 4 |
			(p.z > z + 0.5) << 5;
	}

	function rayTrace(x, y, z, sides) {
		x -= 0.5;
		y -= 0.5;
		z -= 0.5;

		var cf, cd = 1e9; // Closest face and distance
		var m; // Absolute distance to intersection point
		var ix, iy, iz; // Intersection coords

		// Top and bottom faces
		if (Block.top & sides && p.direction.y) {
			m = (y - p.y) / p.direction.y;
			ix = m * p.direction.x + p.x;
			iz = m * p.direction.z + p.z;
			if (m > 0 && m < cd && ix >= x && ix <= x + 1 && iz >= z && iz <= z + 1) {
				cd = m;
				cf = "top";
			}
		}
		y += 1;
		if (Block.bottom & sides && p.direction.y) {
			m = (y - p.y) / p.direction.y;
			ix = m * p.direction.x + p.x;
			iz = m * p.direction.z + p.z;
			if (m > 0 && m < cd && ix >= x && ix <= x + 1 && iz >= z && iz <= z + 1) {
				cd = m;
				cf = "bottom";
			}
		}
		y -= 1;

		// West and East faces
		if (Block.west & sides && p.direction.x) {
			m = (x - p.x) / p.direction.x;
			iy = m * p.direction.y + p.y;
			iz = m * p.direction.z + p.z;
			if (m > 0 && m < cd && iy >= y && iy <= y + 1 && iz >= z && iz <= z + 1) {
				cd = m;
				cf = "west";
			}
		}
		x += 1;
		if (Block.east & sides && p.direction.x) {
			m = (x - p.x) / p.direction.x;
			iy = m * p.direction.y + p.y;
			iz = m * p.direction.z + p.z;
			if (m > 0 && m < cd && iy >= y && iy <= y + 1 && iz >= z && iz <= z + 1) {
				cd = m;
				cf = "east";
			}
		}
		x -= 1;

		// South and North faces
		if (Block.south & sides && p.direction.z) {
			m = (z - p.z) / p.direction.z;
			ix = m * p.direction.x + p.x;
			iy = m * p.direction.y + p.y;
			if (m > 0 && m < cd && ix >= x && ix <= x + 1 && iy >= y && iy <= y + 1) {
				cd = m;
				cf = "south";
			}
		}
		z += 1;
		if (Block.north & sides && p.direction.z) {
			m = (z - p.z) / p.direction.z;
			ix = m * p.direction.x + p.x;
			iy = m * p.direction.y + p.y;
			if (m > 0 && m < cd && ix >= x && ix <= x + 1 && iy >= y && iy <= y + 1) {
				cd = m;
				cf = "north";
			}
		}
		return [cd, cf];
	}

	function runRayTrace(x, y, z, faces) {
		var block = world.getBlock(x, y, z);
		if (block) {
			var rt = rayTrace(x, y, z, faces);

			if (rt[1] && rt[0] < hitBox.closest) {
				hitBox.closest = rt[0];
				hitBox.face = rt[1];
				hitBox.pos = [x, y, z];
			}
		}
	}

	// Checks blocks in front of the player to see which is looked at
	function lookingAt() {
		hitBox.pos = null;
		hitBox.closest = 1e9;
		var pd = p.direction;

		// Target block
		var tx = Math.round(pd.x * reach + p.x);
		var ty = Math.round(pd.y * reach + p.y);
		var tz = Math.round(pd.z * reach + p.z);

		var minX = p2.x;
		var maxX = 0;
		var minY = p2.y;
		var maxY = 0;
		var minZ = p2.z;
		var maxZ = 0;
		var faces = getFaces(tx, ty, tz);

		for (var i = 1; i < reach + 1; i++) {
			if (i > reach) {
				i = reach;
			}
			maxX = Math.round(p.x + pd.x * i);
			maxY = Math.round(p.y + pd.y * i);
			maxZ = Math.round(p.z + pd.z * i);
			if (maxX === minX && maxY === minY && maxZ === minZ) {
				continue;
			}
			if (minX !== maxX) {
				if (minY !== maxY) {
					if (minZ !== maxZ) {
						runRayTrace(maxX, maxY, maxZ, faces);
					}
					runRayTrace(maxX, maxY, minZ, faces);
				}
				if (minZ !== maxZ) {
					runRayTrace(maxX, minY, maxZ, faces);
				}
				runRayTrace(maxX, minY, minZ, faces);
			}
			if (minY !== maxY) {
				if (minZ !== maxZ) {
					runRayTrace(minX, maxY, maxZ, faces);
				}
				runRayTrace(minX, maxY, minZ, faces);
			}
			if (minZ !== maxZ) {
				runRayTrace(minX, minY, maxZ, faces);
			}
			if (hitBox.pos) {
				return;
			}
			minZ = maxZ;
			minY = maxY;
			minX = maxX;
		}
	}

	var inBox = function(x, y, z, w, h, d) {
		var iy = y - h/2 - p.topH;
		var ih = h + p.bottomH + p.topH;
		var ix = x - w/2 - p.w;
		var iw = w + p.w*2;
		var iz = z - d/2 - p.w;
		var id = d + p.w*2;
		return p.x > ix && p.y > iy && p.z > iz && p.x < ix + iw && p.y < iy + ih && p.z < iz + id;
	};

	var boxCollision = function(x, y, z, w, h, d, vx, vy, vz, dt) {
		if (inBox(x, y, z, w, h, d)) {
			if (vx) {
				p.x -= p.velocity.x * dt;
				p.velocity.x = 0;
			}
			else if (vz) {
				p.z -= p.velocity.z * dt;
				p.velocity.z = 0;
			}
			else if (vy > 0) {
				p.y -= p.velocity.y * dt;
				p.velocity.y = 0;
			}
			else {
				p.y = y - h/2 - p.topH + (h + p.bottomH + p.topH);
				p.onGround = true;if (p.velocity.y < -0.4 && !(blockData[inventory.hotbar[inventory.hotbarSlot]].name == "elytra")) {
					hp = hp + (p.velocity.y+0.4) * 16
					p.velocity.y = 0
				}
				p.velocity.y = 0;
			}
		}
	};
	var contacts = {
		array: [],
		size: 0,
		add: function (x, y, z) {
			if (this.size === this.array.length) {
				this.array.push([x, y, z]);
			} else {
				this.array[this.size][0] = x;
				this.array[this.size][1] = y;
				this.array[this.size][2] = z;
			}
			this.size++;
		},
		clear: function () {
			this.size = 0;
		},
	};

	var resolveContactsAndUpdatePosition = function () {
		var minX = p2.x - 1;
		var maxX = p2.x + 1;
		var minY = p2.y - 2;
		var maxY = p2.y + 1;
		var minZ = p2.z - 1;
		var maxZ = p2.z + 1;
		var wrld = world;
		var cont = contacts;
		var block = null;
		var player = p;

		for (var x = minX; x <= maxX; x++) {
			for (var y = minY; y <= maxY; y++) {
				for (var z = minZ; z <= maxZ; z++) {
					if (wrld.getBlock(x, y, z)) {
						cont.add(x, y, z);
					}
				}
			}
		}

		var dt = (win.performance.now() - p.lastUpdate) / 33;
		dt = dt > 2 ? 2 : dt;

		// Check collisions in the X direction
		player.x += player.velocity.x * dt;
		for (var i = 0; i < contacts.size; i++) {
			block = cont.array[i];
			if (blockData[wrld.getBlock(block[0], block[1], block[2])].solid) {
				boxCollision(block[0], block[1], block[2], 1, 1, 1, player.velocity.x, 0, 0, dt);
			}
		}

		// Check collisions in the Y direction
		var dy = Math.abs(player.velocity.y * dt)
		player.y += player.velocity.y * dt;
		for (var i = 0; i < contacts.size; i++) {
			block = cont.array[i];
			if (blockData[wrld.getBlock(block[0], block[1], block[2])].solid) {
				boxCollision(block[0], block[1], block[2], 1, 1, 1, 0, player.velocity.y, 0, dt);
				this.standingOn = world.getBlock(Math.round(player.x), Math.floor(player.y - (dy > 1 ? 2 - dy : 2)), Math.round(player.z))
				if (blockData[this.standingOn] && blockData[this.standingOn].hasOwnProperty("bounciness") && p.velocity.y < -0.2 && !p.flying) {
					p.velocity.y *= -blockData[this.standingOn].bounciness;
				}

				// if (blockData[this.standingOn] && blockData[this.standingOn].name == "cryingObsidian" && blockData[inventory.hotbar[inventory.hotbarSlot]].name == "torchflower") {
				// 	swap = {world:"nether",posx:x,posy:y-1,posz:z}"
				// }

				if (gamemodes[gamemode].name == "Floor=Lava" && !(blockData[this.standingOn].name == "air" || blockData[this.standingOn].crossShape ||  blockData[this.standingOn].name == "glass" || blockData[world.getBlock(p.x, p.y-3, p.z)].name == "glass" || blockData[world.getBlock(p.x, p.y-2, p.z)].name == "glass" || blockData[world.getBlock(p.x, p.y-1, p.z)].name == "glass" ||  blockData[world.getBlock(p.x, p.y-3, p.z)].name == "air")) {
					setTimeout(function() {
						p.x = 8;
						p.y = 82;
						p.z = 8;
					}, 200);

				}
			}
		}

		// Check collisions in the Z direction
		player.z += player.velocity.z * dt;
		for (var i = 0; i < contacts.size; i++) {
			block = cont.array[i];
			if (blockData[wrld.getBlock(block[0], block[1], block[2])].solid) {
				boxCollision(block[0], block[1], block[2], 1, 1, 1, 0, 0, player.velocity.z, dt);
			}
		}


		if (gamemodes[gamemode].name == "Survival" && blockData[world.getBlock(Math.round(p.x), Math.floor(p.y), Math.round(p.z))].name == "lava" || blockData[world.getBlock(Math.round(p.x), Math.round(p.y - 1), Math.round(p.z))].name == "lava") {
			hp -= 0.4;
		}

		// Determine friction
		if (!p.flying) {
			var drag = p.onGround ? 0.5 : 0.85;
			try {
				if (blockData[this.standingOn].slide) {
					drag = blockData[this.standingOn].slide;
				}
				if (blockData[world.getBlock(Math.round(player.x), Math.round(player.y - 1), Math.round(player.z))].slide) {
					drag = blockData[world.getBlock(Math.round(player.x), Math.round(player.y - 1), Math.round(player.z))].slide;
				}
			} catch (err) {}

			p.velocity.z += (p.velocity.z * drag - p.velocity.z) * dt;
			p.velocity.x += (p.velocity.x * drag - p.velocity.x) * dt;
		} else {
			var drag = 0.9;
			p.velocity.z += (p.velocity.z * drag - p.velocity.z) * dt;
			p.velocity.x += (p.velocity.x * drag - p.velocity.x) * dt;
			p.velocity.y += (p.velocity.y * 0.8 - p.velocity.y) * dt;
			if (p.onGround) {
				p.flying = false;
			}
		}

		p.lastUpdate = win.performance.now();
		contacts.clear();
		lookingAt();

		if (hp < 1 && gamemodes[gamemode].name == "Survival") {
			if (worldmode == 2) {
					backupWorlds.nether = world;
					world = undefined;
					if (backupWorlds.overworld) {

						world = backupWorlds.overworld;
						worldmode = 0;
						win.world = backupWorlds.overworld;
					} else {

						worldmode = 0;
						world = World();
						win.world = backupWorlds.overworld;
					}
					p.x *= 2;
					p.y /= 75/100;
					p.z *= 2;
			}

			if (worldmode == 3) {
					backupWorlds.end = world;
					world = undefined;
					if (backupWorlds.overworld) {

						world = backupWorlds.overworld;
						worldmode = 0;
						win.world = backupWorlds.overworld;
					} else {

						worldmode = 0;
						world = World();
						win.world = backupWorlds.overworld;
					}
					p.x *= 2;
					p.y /= 75/100;
					p.z *= 2;
			}
			for (var i = 0; i < survivInv.length; i++) {
				survivInv[i].count  = Math.ceil(survivInv[i].count/2);
			}
			hp = 20;
			p.x = 8;
			p.y = (worldmodes[worldmode].ySpawn ? worldmodes[worldmode].ySpawn : (gamemodes[gamemode].ySpawn ? gamemodes[gamemode].ySpawn : Math.round(noise(8 * generator.smooth, 8 * generator.smooth) * generator.height) + 2 + generator.extra));
			p.z = 8;
		}
	};

	var runGravity = function() {
		if (Key["g"]) {
			p.custom(Math.round(p.x),Math.floor(p.y),Math.round(p.z));
		}

		if (p.flying) {
			this.standingOn = 0;
			if (p.y < -200) {
				p.y = 300;
			}
			if (p.y > 300) {
				p.y = -200;
			}
			return;
		}
		var dt = (win.performance.now() - p.lastUpdate) / 33;
		dt = dt > 2 ? 2 : dt;

		if (p.onGround && !inLiquid(p.x, p.y, p.z) && !canClimb(p.x, p.y, p.z)) {
			if (Key[" "]) {
				reach = 5;
				p.velocity.y = p.jumpSpeed;
				p.onGround = false;
			} else if (Key["6"] && Key["9"]) {
				if (nt == 0) {
					var s = new Sound(sounds.moan);
					s.play();
					nt = 600;
					var f = setInterval(function() {
						if (nt > 520 && Key["6"] && Key["9"]) {
							reach = 24;
							p.nut();
						}
						nt--;
						if (nt <= 0) {
							nt = 0;
							clearInterval(f);
						}
					}, 100);
				}
			} else {
				reach = 5;
				p.velocity.y = 0;
			}
		} else {
      if (inLiquid(p.x, p.y, p.z) && !Key[" "]) {
        p.velocity.y = -0.06
      } else if (canClimb(p.x, p.y, p.z) && !Key[" "]) {
        if (Key.shift) {
          p.velocity.y = 0;
        } else {
          p.velocity.y = -0.04
        }
      } else if (inSnow(p.x, p.y, p.z) && !Key[" "]) {
				p.velocity.y = -0.02;
			} else {
        p.velocity.y += p.gravityStrength * dt;
      }

			if (p.velocity.y < -p.maxYVelocity) {
				p.velocity.y = -p.maxYVelocity;
			}
			if (!worldmodes[worldmode].void && p.y < -120) {
				p.y = 275;
			}
			if (p.y < 1 && hp > 0 && worldmodes[worldmode].void) {
				hp += p.y/500;
			}
			if (p.y < -500 && worldmodes[worldmode].void) {
				p.y = 275;
			}
			if (!worldmodes[worldmode].void && p.y > 275) {
				p.y = -120;
			}
		}
		p.onGround = false;
	};

	function box(sides, tex) {
		var i = 0;
		for (var side in Block) {
			if (sides & Block[side]) {
				vertexAttribPointer("aVertex", programObject3D, "aVertex", 3, sideEdgeBuffers[Sides[side]]);
				if (blockFill) {
					vertexAttribPointer("aTexture", programObject3D, "aTexture", 2, texCoordsBuffers[textureMap[tex[i]]]);
					if (tex[0] != "cactusTop" || tex[0] != "cactusSide" || tex[0] != "cactusBottom") {
						continue;
					}
					gl.drawElements(gl.TRIANGLES, 6, gl.UNSIGNED_INT, 0);
				}

				if (blockOutlines) {
					vertexAttribPointer("aTexture", programObject3D, "aTexture", 2, texCoordsBuffers[textureMap.hitbox]);

					gl.drawArrays(gl.LINE_LOOP, 0, 4);
				}
			}
			i++;
		}
	}

	function block2(x, y, z, t) {
		copyArr(modelView, matrix);
		trans(modelView, x, y, z);
		matMult();
		trans(modelView, -x, -y, -z);
		transpose(matrix);
		uniformMatrix("view3d", programObject3D, "uView", false, matrix);
		box(0xff, blockData[t].textures);
	}

	// block hunt helpers
	function newRiddle() {
		blockHunt.chosen = Math.floor(Math.random() * blockHunt.riddles.length);
	}

	function checkBlockHuntBlock(b) {
		if (blockHunt.riddles[blockHunt.chosen].answers.includes(b)) {
			blockHunt.message = "You got it!  +" + blockHunt.riddles[blockHunt.chosen].score;
			var old = blockHunt.message;
			blockHunt.score += blockHunt.riddles[blockHunt.chosen].score;
			newRiddle();
			setTimeout(function () {
				if (blockHunt.message === old) {
					blockHunt.message = "";
				}
			}, 5000);
		}
	}

	// world helper functions
	var changeWorldBlock = function(t) {
		var pos = hitBox.pos;
		if (!(pos && pos[1] > 0 && pos[1] < maxHeight)) {
			return;
		}
		if (t == 0 && gamemodes[gamemode].blockBreakTime) {
			var dfactor = 1;
			if (blockData[inventory.hotbar[inventory.hotbarSlot]].stone && blockData[world.getBlock(pos[0],pos[1],pos[2])].type == "stone") {
				dfactor *= blockData[inventory.hotbar[inventory.hotbarSlot]].stone
			}
			if (blockData[inventory.hotbar[inventory.hotbarSlot]].wood && blockData[world.getBlock(pos[0],pos[1],pos[2])].type == "wood") {
				dfactor *= blockData[inventory.hotbar[inventory.hotbarSlot]].wood
			}
			if (blockData[inventory.hotbar[inventory.hotbarSlot]].grain && blockData[world.getBlock(pos[0],pos[1],pos[2])].type == "grain") {
				dfactor *= blockData[inventory.hotbar[inventory.hotbarSlot]].grain
			}
			if (blockData[inventory.hotbar[inventory.hotbarSlot]].liquid && blockData[world.getBlock(pos[0],pos[1],pos[2])].type == "fluid") {
				dfactor *= blockData[inventory.hotbar[inventory.hotbarSlot]].liquid
			}
			setTimeout(function() {
				if (JSON.stringify(hitBox.pos) == JSON.stringify(pos)) {
					changeWorldBlockAction(pos, t);
				}
			}, blockData[world.getBlock(pos[0],pos[1],pos[2])].breakTime * dfactor);
		}
		else {
			changeWorldBlockAction(pos, t);
		}

	};

