	function getSubBiome(x, z, biome) {
		if (worldmodes[worldmode].name == "Overworld") {
			if (noise((x-400) * 0.0029, (z-600) * 0.0029) > 0.61 && noise(x * 0.0029, z * 0.0029) < 0.72 && getBiome(x,z,biome).includes("mountain")) {
				return "icecap";
			}
			if (noise((x-300) * 0.0022, (z+300) * 0.0022) < 0.5 && biome > 0.55 && (getBiome(x,z,biome).includes("mountain") || getBiome(x,z,biome).includes("taiga"))) {
				return "snowy";
			}
			else if (noise((x+400) * 0.0029, (z-600) * 0.0029) >= 0.54 && noise(x * 0.0029, z * 0.0029) <= 0.61 && getBiome(x,z,biome).includes("mountain")) {
				return "dotted";
			}
			if (noise(x * 0.0029, z * 0.0029) > 0.595 && getBiome(x,z,biome) == "taiga") {
				return "tall";
			}
			if (noise((x+500) * 0.0022, (z-500) * 0.0022) > 0.55 && getBiome(x,z,biome) == "forest") {
				return "whiteOak";
			}
			if (noise((x-1000) * 0.0024, (z-1000) * 0.0024) < 0.45 && getBiome(x,z,biome) == "forest") {
				return "cherry";
			}
			if (noise((x-500) * 0.0022, (z+1000) * 0.0022) < 0.43 && getBiome(x,z,biome) == "jungle") {
				return "bamboo";
			}
		}
		if (worldmodes[worldmode].name == "Nether") {
			if (noise(x * 0.0032, z * 0.0032) > 0.5 && getBiome(x,z,biome).includes("valley")) {
				return "soil";
			}

		}
		if (worldmodes[worldmode].name == "End") {
			if (biome > .4905 && biome < 0.5095) {
				return "forested"
			}

			if (biome > 0.55 && biome < 0.585) {
				return "purpled"
			}
		}
		return false;
	}

	function getBigStruct(x, z, biome) {
		if (worldmodes[worldmode].name == "Overworld") {
			if (noise(x * 0.0029, z * 0.0029) > 0.495 && noise(x * 0.0029, z * 0.0029) < 0.57 && (getBiome(x,z,biome) == "plains" || getBiome(x,z,biome) == "savanna")) {
				return "village";
			}

			if (noise((x-1000) * 0.0024, (z-1000) * 0.0024) > 0.51 && noise((x-1000) * 0.0024, (z-1000) * 0.0024) < 0.57) {
				return "lushcave";
			}
		}
	}

