	function genSphere(x,y,z,block) {
		for (var i = -10; i <= 10; i++) {
			for (var j = -10; j <= 10; j++) {
				for (var k = -10; k <= 10; k++) {
					if (euclideanDistance(x+i,x,y+j,y,z+k,z) < 8) {
						world.spawnBlock(x+i, y+j-13, z+k, block);
					}
				}
			}
		}
	}

	function genSquare(x,y,z,block) {
		for (var i = -2; i < 3; i++) {
			for (var j = -2; j < 3; j++) {
				world.spawnBlock(x+i, y-3, z+j, block);
			}
		}
	}

	function genCube(x,y,z,block) {
		for (var i = -2; i < 3; i++) {
			for (var j = -2; j < 3; j++) {
				for (var k = -2; k < 3; k++) {
					world.spawnBlock(x+i, y-10+j, z+k, blockIds.bedrock);
				}
			}
		}
	}

	function genX2d(x,y,z,block) {
		for (var i = -2; i < 3; i++) {
			for (var j = -2; j < 3; j++) {
				if (Math.abs(i) == Math.abs(j)) {
					world.spawnBlock(x+i, y-3, z+j, block);
				}
			}
		}
	}

	function genX3d(x,y,z,block) {
		for (var i = -5; i <= 5; i++) {
			for (var j = -5; j <= 5; j++) {
				for (var k = -5; k <= 5; k++) {
					if (Math.abs(i) == Math.abs(j) && Math.abs(i) == Math.abs(k)) {
						world.spawnBlock(x+i, y+j-10, z+k, block);
					}
				}
			}
		}
	}

